import React, {useState, useEffect} from "react";
import UsersRow from "./UsersRow";
import ActivitiesColumn from "./ActivitiesColumn";


function Table() {

    const [currUsers, setCurrUsers] = useState([]);
    const getCurrUsers = () => {
        fetch('/get_users')
            .then(res => res.json())
            .then(json => setCurrUsers(json.users));
    }

    useEffect(() => getCurrUsers(), []);

    const currActivities = ['son', 'buhlo', 'sport'];

    return (
        <table>
            <thead>
            <UsersRow usernames={currUsers}/>
            </thead>
            <tbody>
            <ActivitiesColumn activities={currActivities}/>
            </tbody>
        </table>
    );
}

export default Table;
